piranha.module=new Vue({el:"#module",data:{loading:!0,items:[]},methods:{load:function(){fetch(piranha.baseUrl+"manager/api/module/list").then(function(n){return n.json()}).then(function(n){piranha.module.items=n.items}).catch(function(n){console.log("error:",n)})}},created:function(){this.load()},updated:function(){this.loading=!1}});